import styled from 'styled-components';
import bg from '../img/bg.jpg';

function App() {


const AppStyled =styled.div`
 heigth: 100vh;
 background-image:url(${bg}); ;
 `;
  return (
    <div className="App">
      <header>
        <h1>Expense Tracker</h1>
      </header>
      <main>
        <p>Welcome to your Expense Tracker!</p>
      </main>
    </div>
  );
}


export default App;
